import * as React from 'react'

const CheckMark = () => {
  return (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 50 50">
      <polygon
        points="15.13 25.31 16.93 23.51 22.81 29.39 34.69 17.63 36.37 19.31 22.81 32.87 15.13 25.31"
        fill="#fff"
      />
    </svg>
  )
}

export default CheckMark
